import React from 'react';

const Services = () => {
  return (
    <section id="services" className="py-16 bg-white text-center">
      <h2 className="text-3xl font-bold mb-10 text-gray-800">Our Services</h2>
      <div className="max-w-5xl mx-auto grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-8">
        {['VCFO Services', 'Startup Advisory', 'Tax Compliance'].map((service, index) => (
          <div key={index} className="p-6 shadow-md rounded-xl hover:shadow-lg border border-gray-100">
            <h3 className="text-xl font-semibold text-purple-700 mb-2">{service}</h3>
            <p className="text-sm text-gray-600">We provide expert financial services tailored to your business goals.</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Services;
